import * as React from 'react';
import { View, Text, Image, TouchableOpacity } from 'react-native';
import { SafeAreaView } from 'react-native-web';
import { assets } from '../../constants';

export default function Akun({ navigation }) {
    return (
        <SafeAreaView style={{ flex:1 }}>
            <View style={{ zIndex:0, width: "100%", height:250 }}>
                <TouchableOpacity style={{ width:80, height:80, margin:10, backgroundColor:"#9CCF89", alignItems: 'center', justifyContent:'center' }}>
            <Image source={assets.car}
              resizeMode="contain"
              style={{ width:40,height:40 }}/>
          </TouchableOpacity>
            </View>
            <View style={{ flex:1 }}>
                <View style={{ position:"absolute",
                top: 0,
                bottom: 0,
                right:0,
                left:0,
                zIndex:-1, }}/>
                <View style={{ height:"100%", backgroundColor:"#143D71" }}/>
            </View>
        </SafeAreaView>
    );
}
